import logo from './logo.svg';
import './App.css';
function Todos1 (props) {
  return (
    <>
    <div>
      <div>
        <h5>tugas w11</h5>
        <p>tugas Rossan Husen</p>
      </div>
      <div>
        {props.tanggal}
      </div>
    </div>
    </>
  )
}
function App() {
  const name = "rosanhusen";
  return (
    <div>
      <h1>Todo list {name}</h1>
      <div>
        <Todos1 tanggal = "13-11-2023"/>
      </div>
    </div>
  );
}

export default App;
